import React, { useState, useEffect, createContext, useContext } from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import { firedb, Firebase } from './firebase'
import { AuthContext, AuthProvider } from "./auth/AuthContext";
import ProtectedRoute from "./auth/ProtectedRoutes";
import {Landing} from "./components/Landing";
import CreateReservation from './components/CreateReservation'
import Home from './components/Home'
import YourReservation from './components/YourReservations'
import Reservation from './components/Reservation'

import logo from './logo.svg';
import './App.css';


function App() {

  // const [email, setEmail] = useState()


  // useEffect(() => {
  //   Firebase
  //     .auth()
  //     .onAuthStateChanged((user) => {
  //       console.log(user.email)
  //       console.log(user)

  //     });
  // }, [0])

  return (
    <div>
      <AuthProvider>
        <Router>
          <Switch>
            <Route exact path="/" component={Landing} />
            <ProtectedRoute exact path="/home" component={Home} />
            <ProtectedRoute exact path="/reservation" component={Reservation} />
            <ProtectedRoute exact path="/createreservation" component={CreateReservation} />
            <ProtectedRoute exact path="/yourreservations" component={YourReservation} />
          </Switch>
        </Router>
      </AuthProvider>
    </div>
  );
}

export default App;
